const Articles = ({ stateName, data }) => {

  useEffect(() => {
    console.log(data)
  }, [])


  return (
    <div>
      <h1>Articles about {stateName}</h1>
      {data && data.map(item => {
        <div key={item.title} className="supplemental-articles-item-container">
          <h4>{item.title}</h4>
          {item.types.map(val => {
            return (
              <p>{val}</p>
            )
          })}
        </div>
      })}
    </div>
  )
}

export default Articles;
